import React from "react";
import ReactDOM from "react-dom";

class Filter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      schools: [],
      School: "",
    };

    this.handleSubmitSchool = this.handleSubmitSchool.bind(this);
  }

  handleSubmitSchool(event) {
    alert("Your selected value is: " + this.state.School);
    event.preventDefault();
  }

  handleChangeSchool = (event) => {
    this.setState({ School: event.target.value });
  };

  getUnique(arr, comp) {
    const unique = arr
      //store the comparison values in array
      .map((e) => e[comp])

      // store the keys of the unique objects
      .map((e, i, final) => final.indexOf(e) === i && i)

      // eliminate the dead keys & store unique objects
      .filter((e) => arr[e])

      .map((e) => arr[e]);

    return unique;
  }

  componentDidMount() {
    const schools = require("../dataraw/json/Backpack_raw.json");
    this.setState({ schools: schools });
  }

  render() {
    const uniqueSchool = this.getUnique(this.state.schools, "School");

    const schools = this.state.schools;
    const School = this.state.School;

    const filterDropdown = schools.filter(function (result) {
      return result.School === School;
    });

    return (
      <div>
        <form onSubmit={this.handleSubmitSchool}>
          <br />
          <br />
          <label>
            <select
              value={this.state.School}
              onChange={this.handleChangeSchool}
            >
              {uniqueSchool.map((School) => (
                <option key={School.School_ID} value={School.School}>
                  {School.School}
                </option>
              ))}
            </select>
          </label>
          <input type="submit" value="Submit" />
          <div>
            {filterDropdown.map((School) => (
              <div key={School.School} style={{ margin: "10px" }}>
                {School.NUS_Module_Code}
                {School.Continent}
                <Table celled>
                  <Table.Body>
                    <Table.Row>
                      <Table.Cell>
                        "School Code": "E0000000544", "Continent": "Asia",
                        "School": "Korea University", "Semester details": "tbc",
                        "NUS_Module_Code": "ACC1002X, ACC1701X, BSP1005,
                        BSP1703, BSP2001, BSP2701, BSP3001, BSP3701, BSP4513,
                        DAO2703, DOS3701, DOS3702, DOS3703, DOS3811, DSC2006,
                        DSC3201, DSC3202, DSC3203, DSC3211, DSC3219, DSC3222,
                        DSC3222X, FIN2004, FIN2704, FIN2704X, FIN3101, FIN3101A,
                        FIN3102, FIN3103, FIN3113, FIN3115, FIN3116, FIN3117,
                        FIN3119, FIN3120, FIN3120X, FIN3120Y, FIN3120Z, FIN3131,
                        FIN3701, FIN3702, FIN3703, FIN3711, FIN3712, FIN3713,
                        FIN3715, FIN3717, FIN3761X, FIN3761Y, FIN3761Z,
                        FIN4112C, MKT1003, MKT1705, MKT1705X, MKT2401, MKT2412,
                        MKT2413, MKT3402, MKT3412, MKT3413, MKT3416, MKT3418,
                        MKT3420, MKT3422X, MKT3422Y, MKT3422Z, MKT3513, MKT3701,
                        MKT3702, MKT3711, MKT3712, MKT3717, MKT3718, MNO1001,
                        MNO1706, MNO1706X, MNO2007, MNO2009, MNO2302, MNO3301,
                        MNO3303, MNO3313, MNO3313X, MNO3313Y, MNO3313Z,
                        MNO3322", "School site":
                        "https://biz.korea.ac.kr/eng/main/main.html", "School
                        Review?": "yes"
                        <Label ribbon>School Code</Label>
                      </Table.Cell>
                      <Table.Cell>{School.School_Code} </Table.Cell>
                      <Table.Cell>FIN3101 Corporate Finance</Table.Cell>
                    </Table.Row>
                    <Table.Row>
                      <Table.Cell>
                        <Label ribbon>Choice 2</Label>
                      </Table.Cell>
                      <Table.Cell>BA-BHAAV2389U Behavioural Finance</Table.Cell>
                      <Table.Cell>
                        FIN3120X Topic in Finance: Behavioural Finance
                      </Table.Cell>
                    </Table.Row>
                    <Table.Row>
                      <Table.Cell>
                        <Label ribbon>Choice 3</Label>
                      </Table.Cell>
                      <Table.Cell>BA-BISHO2002U Risk Management</Table.Cell>
                      <Table.Cell>FIN3714 Financial Risk Management</Table.Cell>
                    </Table.Row>
                    <Table.Row>
                      <Table.Cell>
                        <Label ribbon>Choice 4</Label>
                      </Table.Cell>
                      <Table.Cell>
                        BA-BHAAC2262U Entrepreneurial Finance
                      </Table.Cell>
                      <Table.Cell>
                        FIN3120X Topic in Finance: Entrepreneurial Finance
                      </Table.Cell>
                    </Table.Row>
                    <Table.Row>
                      <Table.Cell>
                        <Label ribbon>Choice 5</Label>
                      </Table.Cell>
                      <Table.Cell>
                        BA-BHAAV1366U Strategic Management
                      </Table.Cell>
                      <Table.Cell>BSP3701 Strategic Management</Table.Cell>
                    </Table.Row>
                  </Table.Body>
                </Table>
                <br />
              </div>
            ))}
          </div>
        </form>
      </div>
    );
  }
}
export default Filter;

ReactDOM.render(<Filter />, document.querySelector("#root"));
